import list from "../JsonFiles/listApi.json";
import axios from "axios";

function Home() {
  const [listDetails, setListdetails] = useState(list);

  function importAll(r) {
    let images = {};
    r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
    return images;
}

const images = importAll(require.context('./images', false, '/\.png/'));


  console.log(listDetails);
    useEffect(() => {

        axios.get('http://34.93.21.66:3000/api/alpaca/list')
            .then(response => {
              setListdetails(response)
            })
            .catch((error) => {
                console.error(error);
              });

    }, []);

  return (
    <div className="home">
      <div className="container">
       <div className="row mt-5">
        <h4>Popular Stocks</h4>
       </div>
       <div className="row mt-5">
        <div className="col-md-10 col-sm-10 col-10">COMPANY</div>
        <div className="col-md-2 col-sm-2 col-2">MARKET PRICE</div>
        <div className="container">
        {listDetails !== undefined &&
          listDetails.assetInfo.map((items,key) => {
              return (
                  <div className="row">
                     <div >{items.name}
                     </div>
                  </div>
                  );
          })}
        </div>
       </div>
      </div>
    </div>
  );
}

export default Home;
